package week1.day1.assingments;

public class Factorial {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int input =5;
		
		int f=1;
		for(int i= 1; i<=input;i++) {
			
			f=f*i;
		}
		System.out.println("The factorial is");
			System.out.println(f);

	}

}
